import React from 'react';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';
import "./header.css";
import { Anchor} from 'antd';

const labels = ['', 'Skills', 'Projects', 'Contact'];

const AppHeader = () => {
  return (
    <header> {/* Burada AppHeader bileşenini bir <header> etiketi içine aldık */}
      <div className='header'>
        <div className='logo' />
        <Anchor targetOffset="100" direction='horizontal'
          items={[
            {
              key: 'banner',
              href: '#banner',
              title: 'Banner',
            },
            {
              key: 'feature',
              href: '#feature',
              title: 'Feature',
            },
            {
              key: 'hero',
              href: '#hero',
              title: 'Projects',
            },
            {
              key: 'contact',
              href: '#contact',
              title: 'Contact',
            },
          ]}
        />
        <div className="icon-container">
          <a href="https://github.com/zehragizem" target="_blank" rel="noopener noreferrer" className="github">
            <GithubOutlined style={{ fontSize: '18px', color: '#fff' }} />
          </a>
          <a href="https://www.linkedin.com/in/zehra-gizem-duman-344952237" target="_blank" rel="noopener noreferrer" className="linkedin">
            <LinkedinFilled style={{ fontSize: '18px', color: '#fff' }} />
          </a>
        </div>
      </div>
    </header>
  );
}

export default AppHeader;
